import "./batballstyle.css";
import Duration from "./duration";
export default function Matches(props){
    return(
    <div className="frame">
        
         <p className="format">{props.format}  </p>
   <center><p className="match">{props.match}  </p></center>
    <Duration timings={props.timings}/>
    <p className="venue">{props.venue} </p>
   </div>
    )
}
